package dreamschool.cscourse.chapter05;

public class GuGuDanTest {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(int dan = 2; dan<=9 ; dan++) {
			for(int i = 2; i<=9 ; i++) {
				System.out.print(dan + "*" + i + "=" + dan*1+"\t");
			}
			System.out.println();
		}

	}

}
